import './App.css';
import Card from './components/card';
import carddata from './carddata';
import Cardholder from './components/card-holder';

function App() {

  const  addingcards = carddata.datas.map(card => {
    return(
     <Card
      id= {card.id}
      name= {card.name}
      value= {card.value}
     />)    
  })

  return (
    <div className="App">
      <div className='leftHeaderItems'>
        {addingcards}
      </div>
      <Cardholder/>
    </div>
  );
}

export default App;
